 --Segunda Problematica
 DROP VIEW clientesMenores40;
 
 CREATE VIEW clientesMenoresDe40 AS SELECT *, date('now') as fecha,
strftime ('%Y', date('now'))- strftime ('%Y', date(dob)) as EDAD
FROM cliente WHERE EDAD >40  ORDER BY CAST(customer_DNI as INT) ASC;

SELECT customer_id as 'ID', branch_id as 'N sucursal',customer_name as 'Nombre', 
customer_surname as 'Apellido', customer_DNI as 'DNI' , EDAD from clientesMenoresDe40;


